import React from 'react'
import './RoomSetup.css'

function RoomSetup({ joinedRoom }) {
	const clicker = () => {
		joinedRoom = true;
	}

	return (
		<div className="roomsetup">
			<button onClick={ (e) => clicker() } > 
				click me	
			</button>
		</div>
	)
}

export default RoomSetup
